import React from 'react';
import {Formik, Field, Form} from 'formik';
import {Button, TextField, FormControlLabel, Checkbox, Radio} from "@material-ui/core";

export const FormikForm2 = () => {
  return (
    <div>
      <Formik initialValues={{
        name: "",
        email: "",
        password: ""
      }} onSubmit={(data, {setSubmitting}) => {
        setSubmitting(true);
        //async call
        console.log(data);
        setSubmitting(false);
      }}
      >
        {({values, isSubmitting}) => (
          <Form className="form">
            <Field
              name="name"
              type="input"
              autoComplete="off"
              variant="outlined"
              label="Name"
              as={TextField}
            />
            <Field
              name="email"
              type="input"
              autoComplete="off"
              variant="outlined"
              label="Email"
              as={TextField}
            />
            <Field
              name="password"
              type="input"
              autoComplete="off"
              variant="outlined"
              label="Password"
              as={TextField}
            />

            <Button type="submit" variant="contained">SUBMIT</Button>
            <pre>
              {JSON.stringify(values, null, 2)}
            </pre>
          </Form>
        )}
      </Formik>
    </div>
  )
};
